import terabot from '../files/Terabot.png';
import './Terabot.css';

export default function Terabot(){
    return(
        <div className="Container" style={{'margin-top':'10px'}}>
            <h3>Terabot</h3>
            <div className="Text" style={{'float':'left', 'width':'40'}}>

                <br />
                <p>
                Material handling in industries to manouver over harsh terrain to perform varios tasks with specialised hand.
                </p>
            </div>
            <div className="Image" style={{'float':'right', 'width':'50%'}}>
                <img src={terabot} style={{'width':'40%', 'height':'40%'}}></img>
            </div>
        </div>
    );
}
